import 'bootstrap/dist/css/bootstrap.css';

class Counter extends Component {

    render() {
        return(
            <div className="container">
                <div className="row">
                    <div className="col-xs-10 col-xs-offset-10">
                        <h1>Hello!</h1>
                    </div>
                </div>
            </div>
          );

    }

}

export default Counter;
